Cast:Jessie Lee, Julia Ann, Molly Bennet, Stormy Daniels, Veronica Avluv

Now in their 30s, best friends Leanne, Stacy and Carmen find themselves single and somewhat emotionally lost. After trying to heal through traditional methods, the trio decides a road trip is in order. Comedy - and Hot Sex - ensues as each tries drastically different approaches to get back in the saddle!

